INSERT INTO `tbl_article` VALUES (1,1,1,'关于秒Po','','','<p>&ldquo;秒Po&rdquo;是中国学生的极简信息发布平台。平台以各校区独立运营、免注册极简发布等模式，让学生间的信息交互更加简洁、高效和相对安全，有效解决聊天群信息分数、大众平台繁琐杂乱等问题。</p>\r\n\r\n<p>我们鼓励对创业和&ldquo;秒Po&rdquo;感兴趣的同学在自己学校建立并运营&ldquo;秒Po&rdquo;，我们会给予网站、服务器、运营、广告合作等全方位的支持。可以通过&ldquo;<a href=\"http://miaopost.com/article/view?id=2\">创建本校秒Po</a>&rdquo;了解详情及申请成为运营者。</p>\r\n\r\n<p>欢迎大家关注请我们的微信、微博、Facebook官方账户：</p>\r\n\r\n<p><strong>微信公众号：&ldquo;秒Po&rdquo;</strong></p>\r\n\r\n<p><img alt=\"\" src=\"data:image/jpeg;base64,\" style=\"height:191px; width:191px\" /></p>\r\n\r\n<p><strong>微博官方账号：<ins><a href=\"https://weibo.com/u/6517278112?refer_flag=1001030101_&amp;is_hot=1\">&ldquo;秒Po&rdquo; </a></ins></strong></p>\r\n\r\n<p><strong>Facebook官方账号：<ins><a href=\"https://www.facebook.com/miaopost/\">&ldquo;秒Po&rdquo;</a></ins></strong></p>\r\n\r\n<p>&nbsp;</p>',2,0,'2018-04-08 19:36:54'),(2,1,1,'创建本校秒Po','','','<p>我们鼓励对创业和&ldquo;秒Po&rdquo;感兴趣的同学在自己学校建立并运营&ldquo;秒Po&rdquo;，进行一次有意义的创业实践。秒Po总部会给予同学们网站、服务器、运营、广告合作等全方位的支持。</p>\r\n\r\n<p><strong>为什么选择创建本校秒Po？</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>独立运营一个平台，是很好的经历和锻炼，可以写进简历。</p>\r\n	</li>\r\n	<li>\r\n	<p>运营团队无需专门的技术人才，无需花费时间开发。&ldquo;秒Po&rdquo;总部提供网站和技术支持。</p>\r\n	</li>\r\n	<li>\r\n	<p>更容易获得广告收入。总部会分配全国性的广告给各校区。</p>\r\n	</li>\r\n	<li>\r\n	<p>灵活。可以获得总部带来的广告机会及广告收入，也可以自己与所在城市的商家洽谈合作；有独立权限在网站最显眼的广告位发布学校相关通知或广告；也可以在总部提供的免费子域名基础上有额外的独立域名和自己的网站Logo。</p>\r\n	</li>\r\n	<li>\r\n	<p>节省资金，人力。总部会提供服务器、域名、网站维护和广告维护系统。总部会投放广告，让产品宣传更加容易。</p>\r\n	</li>\r\n	<li>\r\n	<p>产品相对成熟，极简模式更符合学生需求。</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>申请条件</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>热爱创业，有一定组织领导能力，能够组建起一支团结、有执行力的运营团队。</p>\r\n	</li>\r\n	<li>\r\n	<p>熟悉社交媒体宣传及其他校园宣传方式。</p>\r\n	</li>\r\n	<li>\r\n	<p>勇于克服困难，有持之以恒的创业精神。</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>收入和支出</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>各校区运营团队除了拥有黄金展位的最高支配权外，还有独立洽谈商家在本校区秒Po任何广告位投放广告的权利，广告收益的85%归运营团队所有。 此外，总部也会将全国性广告分配至各校区，各校区可以获得总部广告收益的15%。</p>\r\n	</li>\r\n	<li>\r\n	<p>每年向总部支付费用280元人民币（或$45），包括服务器费、域名费、品牌费、网站建立及维护费用等。（条件突出的申请者可以减免）</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>申请方式</strong></p>\r\n\r\n<p>请将申请发送邮件至 <a href=\"mailto:miaopost@126.com\">miaopost@126.com</a></p>\r\n\r\n<p><strong>申请文档参考：</strong></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>计划运营的范围（请注明学校名称及校区名称，唯一校区请说明为唯一校区，可以将相邻的几所学校或多所学校视为运营范围，建立统一的秒Po）</p>\r\n	</li>\r\n	<li>\r\n	<p>学校/校区学生人数（大约即可）</p>\r\n	</li>\r\n	<li>\r\n	<p>个人及团队成员人数、分工情况（2-3人为适宜的初期团队人数。如尚未组建团队请证明有条件组建合格的运营团队）</p>\r\n	</li>\r\n	<li>\r\n	<p>个人及团队优势</p>\r\n	</li>\r\n	<li>\r\n	<p>如果通过申请，计划如何进行初期宣传推广</p>\r\n	</li>\r\n	<li>\r\n	<p>联系人姓名</p>\r\n	</li>\r\n	<li>\r\n	<p>联系方式（电话、微信或邮箱）</p>\r\n	</li>\r\n	<li>\r\n	<p>其他补充说明</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>',1,0,'2018-04-09 04:56:52'),(5,2,1,'买保险','/uploads/2018/4/13/201804131551346374.png','','<h3>我们提供中文服务，让您更好了解您的保险。</h3>\r\n\r\n<h3>我们给您准确报价，不让您多花一分冤枉钱。</h3>\r\n\r\n<h3>我们为您提供：汽车保险、房屋保险、人寿保险、商业保险。</h3>\r\n\r\n<p><strong>地址：</strong>2929 N Central Expy Ste 120</p>\r\n\r\n<p><strong>联系人：</strong>Lindsay Wu</p>\r\n\r\n<p><strong>联系方式：</strong>972.407.9226（office）</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 469.543.9475（Cell）</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 469.543.9473（Cell）</p>\r\n\r\n<p><strong>微信：</strong></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"\" src=\"/uploads/2018/4/13/201804131552412326.png\" style=\"height:244px; width:242px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/uploads/2018/4/13/201804131553488434.jpg\" style=\"height:326px; width:970px\" /></p>',1,0,'2018-04-13 15:54:18'),(6,2,3,'买保险','/uploads/2018/4/13/201804131555323513.png','http://www.miaopost.com/article/view?id=5','',0,-1,'2018-04-13 15:55:43'),(7,2,3,'秒Po服务号','/uploads/2018/4/23/201804230139096333.png','